#announcements-section.p1-top .pod-body>*:first-child {
	font-size: 1.15em;
	font-weight: bold;
}

.pod-body h1 {
	border-bottom: 2px solid #999;
	color: #000 !important;
}

p.compact
{
	margin-bottom: 0;
}


#announcements-section .pullout-left p {
	margin-bottom: 0.85em;
}

